% Nyan cat on MATLAB
%
% Run this script.
% You can stop Nyan by closing the figure.
% Enjoy nyan cat to your heart's content.
%
% Repository
% https://github.com/elgar328/matlab-code-examples/tree/main/nyancat

clear; clc; close all;

% Load image
[frames, map] = get_image();

% Load audio
audio = get_audio();

% Figure window
h_figure = figure(...
    'Color', [6 0 82]/255, ...
    'NumberTitle', 'off', ...
    'ToolBar', 'none', ...
    'MenuBar', 'none', ...
    'Visible','off', ...
    'Name', 'Nyan Cat', ...
    'SizeChangedFcn', @resizeCallback);
h_axis = imshow(frames(:,:,1), map, 'Border','tight');
set(h_figure, 'Position', [50, 50, 700, 700], 'Visible','on')
set(gca, 'Position', [0 0 1 1])

% Annotation
h_textbox = annotation(gcf, ...
    'textbox',[0 0 1 0.05], ...
    'String','You have nyaned for 0 seconds!', ...
    'Color',[1 1 1],...
    'VerticalAlignment','middle', ...
    'HorizontalAlignment','center', ...
    'FontSize',16, ...
    'FontName','Helvetica Neue', ...
    'FitBoxToText','off', ...
    'EdgeColor','none');

% Scheduled time to update frame
FRAME_INTERVAL = 0.070484375;
f_scheduled = FRAME_INTERVAL;

% Intro loop
sound(audio.intro, audio.Fs)
tic();
while isvalid(h_figure)
    if toc >= f_scheduled
        update_frame(h_axis, h_textbox, frames);
        f_scheduled = f_scheduled + FRAME_INTERVAL;
        
        if toc >= (6*9-1-eps)*FRAME_INTERVAL
            f_scheduled = 6*9*FRAME_INTERVAL;
            a_scheduled = f_scheduled;
            break
        end
    end
end

% Main loop
while isvalid(h_figure)
    if toc >= f_scheduled
        update_frame(h_axis, h_textbox, frames);
        f_scheduled = f_scheduled + FRAME_INTERVAL;
    end
    if toc >= a_scheduled
        sound(audio.loop, audio.Fs);
        a_scheduled = a_scheduled + 6*64*FRAME_INTERVAL;
    end
end
clear sound

function update_frame(h_axis, h_textbox, frames)
    persistent frame_counter
    if isempty(frame_counter)
        frame_counter = 1;
    end

    h_axis.CData = frames(:,:,frame_counter);
    h_textbox.String = sprintf('You have nyaned for %d seconds!',floor(toc));
    drawnow

    if frame_counter >= 12
        frame_counter = 1;
    else
        frame_counter = frame_counter + 1;
    end
end

function resizeCallback(src, ~)
    w = src.InnerPosition(3);
    h = src.InnerPosition(4);
    d = (max(w,h)/min(w,h)-1)/2;
    src.Children.Position = [-d -d 1+2*d 1+2*d];
end

