fwrite(fid, matlab.net.base64decode(data_str), 'uint8');
fclose(fid);

[y, Fs] = audioread(file_name);

delete(file_name);

t = (0:1/Fs:(size(y,1)-1)/Fs)';
ind = (t >= 0.182) & (t < 3.988);
audio.intro = y(ind);
ind = (t >= 3.988) & (t < 31.054);
audio.loop = y(ind);
audio.Fs = Fs;

end